import './App.css';
import React, { Fragment } from 'react';
import { Button, TextField, Icon, Grid, Paper, } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  mainGrid: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

function RowName() {
  return (
    <div className="rowName">
      <label>Name</label>
      <TextField className="inputName" id="outlined-basic" label="Name" variant="outlined" />
    </div>
  );
}

function RowDate() {
  return (
    <div className="rowDate">
      <label>Date</label>
      <TextField
        className="inputDate"
        id="date"
        label="Register Date"
        type="date"
        defaultValue="2017-05-24"
        InputLabelProps={{
          shrink: true,
        }}
      />
    </div>
  );
}

function SendBtn() {
  return (
    <div className="sendBtn">
      <Button
        variant="contained"
        color="primary"
        endIcon={<Icon>send</Icon>}
      >
        Send
    </Button>
    </div>
  );
}

function RowContext() {
  return (
    <div className="rowContent">
      <label>Context</label>
      <TextField
        className="inputContext"
        id="outlined-basic"
        label="Context"
        variant="outlined"
        fullWidth="true"
        multiline
      />
    </div>
  );
}

function App() {
  const classes = useStyles();

  return (
    <div className={classes.mainGrid}>
      <form>
        <Grid
          container
          direction="row"
          justify="center"
          alignItems="center"
          spacing={3}
        >    {/* item과의 거리 spacing 숫자 * 8px */}
          <Grid item xs>
            <RowName />
          </Grid>
          <Grid item xs>
            <RowDate />
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid item xs>
            <RowContext />
          </Grid>
        </Grid>
      </form>
      <Grid container spacing={3}>
        <Grid item xs>
          <SendBtn />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
